css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix(about:neterror), 
url-prefix(about:neterror?e=netTimeout) {

html 
{ background: -moz-linear-gradient(top, #000, #222,#000) fixed !important; }

#errorPageContainer 
{ margin-top: 152px !important;
background: transparent !important;
font-family: Segoe print, constantia, sans serif !important;
color: #000 !important;
text-shadow: 0 0 6px #ff0000!important;
border-radius: 5px !important;
border: 2px solid #000 !important;
-moz-box-shadow: 1px 1px 8px 4px rgba(255,0,0, .5) !important;
border-radius: 55px 0px 55px 0px !important;  }

#errorTitleText,
#errorShortDescText 
{ border: none !important; }
#errorShortDescText{color:#000!important;text-shadow: 0 0 5px #3311ff!important;
padding-left: 60px;}
#errorTitleText{color:#1199ff!important;text-shadow: 0 0 5px #00ff00!important;
  padding-left: 180px;padding-bottom:17px!important;}
#errorLongDesc
{ margin-left: 40px !important; }

#errorTryAgain 
{ -moz-appearance: none !important;
margin-left: 240px !important;
padding: 6px !important;
color: #500 !important;
text-shadow: 0 0 3px #ffff00!important;
background: rgba(0,0,0,.7) !important;
box-shadow: inset 1px 1px 1px  rgba(50,0,0, 2), inset 0px 1px 1px #500, 1px 1px 1px rgba(0,0,0,.5) !important;
border-radius: 15px 0px 15px 0px !important;
border:2px solid rgba(0,0,0,.9) !important; }

#errorTryAgain:hover 
{ color: #400 !important;
background: rgba(0,0,0,.5) !important; }

#moreInfoLink 
{ color: #777 !important; }
#moreInfoLink:hover 
{ color: black !important; }

#errorPageContainer
{ background-repeat: no-repeat !important;background-size:26%!important;
background-image: url(data:image/gif;base64,) !important; }}

@-moz-document url-prefix(about:neterror?e=netTimeout) {
#errorPageContainer 
{ background-repeat: no-repeat !important;background-size:26%!important;
background-image: url(data:image/gif;base64,) !important; } }
